sys_script_include.script:
(function() {
	angular.module('subjectContainsFilter', []).filter('subjectContains', function() {
		return function(input, filtervalue) {
			var output = [];
			if (filtervalue) {
				for (var i = 0; i < input.length; i++) {
					var subject = input[i].subject || input[i]["subject"];
					if (subject.toLowerCase().indexOf(filterValue) != -1) {
						output.push(input[i]);
					}
				}
				return output;
			} else {
				return input;
			}
		};
	});
})();
